import './App.css';

function App() {
  return (
    <div>
      <header>
        <p>
          Hello, I'm Maria.
        </p>
        <a
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          This is the weather-app starter code for Build a Website II
        </a>
      </header>
    </div>
  );
}

export default App;
